script: |
  super -f text -I q9134.spq | sort > q9134.out

inputs:
  - name: q9134.spq
    data: |
      SELECT cor0.col2 * col1 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE ( col0 ) BETWEEN ( col1 + - col2 * col2 ) AND ( + col0 * - col1 );
  - name: tab1

outputs:
  - name: q9134.out
    data: |
